import React, { Component } from "react";



class Home extends Component {
  render() {
    return (
      <div class="container">
        <h2>HELLO</h2>

        <div class="row">
      <div class="col-lg-4">
        <div class="card mb-5 mb-lg-0">
          <div class="card-body">
            <h5 class="card-title text-muted text-uppercase text-center">test</h5>
            <h6 class="card-price text-center"><span class="period">best</span></h6>

            <ul class="fa-ul">
              <li><span class="fa-li"><i class="fa fa-check"></i>test</span></li>
                  <li class="text-muted"><span class="fa-li"><i class="fa fa-times"></i></span>Free Subdomain</li>
              <li class="text-muted"><span class="fa-li"><i class="fa fa-times"></i></span>Monthly Status Reports</li>
            </ul>



        </div>
      </div>
        </div>
        </div>



        <p>Duis a turpis sed lacus dapibus elementum sed eu lectus.</p>
      </div>
    );
  }
}

export default Home;
